function _precompile_()
    ccall(:jl_generating_output, Cint, ()) == 1 || return nothing
    Base.precompile(Tuple{Type{Note},Nothing,Nothing,Rest,Nothing,UInt64,Nothing,String,Nothing,Nothing,EzXML.Node})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:attributes, :notes),Tuple{Attributes,Array{Note,1}}},Type{Measure}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:channel, :program, :volume, :pan, :id),Tuple{Int64,Int64,Int64,Int64,String}},Type{MidiInstrument}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:measures, :id),Tuple{Array{Measure,1},String}},Type{Part}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:name, :midiinstrument, :id),Tuple{String,MidiInstrument,String}},Type{ScorePart}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:partlist, :parts),Tuple{PartList,Array{Part,1}}},Type{ScorePartwise}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:pitch, :duration),Tuple{Pitch,Int64}},Type{Note}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:pitch, :duration, :chord),Tuple{Pitch,Int64,Chord}},Type{Note}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:rest, :duration),Tuple{Rest,Int64}},Type{Note}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:scoreparts,),Tuple{Array{ScorePart,1}}},Type{PartList}})
    Base.precompile(Tuple{getfield(Core, Symbol("#kw#Type")),NamedTuple{(:time, :divisions, :clef, :staves, :key),Tuple{Time,Int64,Array{Clef,1},Int64,Key}},Type{Attributes}})
    Base.precompile(Tuple{typeof(Base.vect),Clef,Vararg{Clef,N} where N})
    Base.precompile(Tuple{typeof(Base.vect),Note,Vararg{Note,N} where N})
    Base.precompile(Tuple{typeof(Base.vect),Part,Vararg{Part,N} where N})
    Base.precompile(Tuple{typeof(Base.vect),ScorePart,Vararg{ScorePart,N} where N})
    Base.precompile(Tuple{typeof(iterate),Array{Note,1}})
    Base.precompile(Tuple{typeof(println),Base.PipeEndpoint,Pitch})
    Base.precompile(Tuple{typeof(println),Pitch})
    Base.precompile(Tuple{typeof(readmusicxml),String})
    Base.precompile(Tuple{typeof(vcat),Measure,Measure})
    Base.precompile(Tuple{typeof(writemusicxml),String,Vararg{Any,N} where N})
end
